import React, { useState, useEffect } from 'react'
import PostImg from '../PostPage/PostImg'
import '../../Style/Introduce2.css'
import '../../Style/PostBody.css'
import PostAdd from './PostAdd'
import Web3 from 'web3'
import Genesis from '../../abi/GenesisFactory.json'
import ProcessBody from './ProcessBody'

const web3 = new Web3(Web3.givenProvider || "https://rinkeby.infura.io/v3/9aa3d95b3bc440fa88ea12eaa4456161")
const GenesisContract = new web3.eth.Contract(Genesis,'0xB21653754E20bf7A4c93F9a9A3E215e4234b70E1')

function PostBody() {

    function test(){
        try {
            // GenesisContract.
            // methods.
            // CreateGenesis(
            //     "CompanyName","ProductName","Image","Code","1","0x965ecf3b23E96f095F1811096333731610abA986"
            // )
            // .send({from: "0x5Bb46Ecc36DB1B4Af38eDa24e0D4633026D8AaD5"},
            // function(error, transactionHash){console.log(transactionHash)});
            var x = web3.eth.accounts.privateKeyToAccount('0x348ce564d427a3311b6536bbcff9390d69395b06ed6c486954e971d960fe8709')
            console.log(x)
        } catch (error) {
            console.log("loi", error)
        }
    }

    function send(){
        try {
            var y = GenesisContract.
            methods.
            CreateGenesis(
                "CompanyName","ProductName","Image","Code","1","0x965ecf3b23E96f095F1811096333731610abA986"
            )
            .send({from: "0x5Bb46Ecc36DB1B4Af38eDa24e0D4633026D8AaD5"})
            console.log(y)
        } catch (error) {
            console.log("loi", error)
        }
    }

    return (
        <>
        <div className='postbody-container'>
            <div className='postbody-box'>
                <div className='postbody-box-left'>
                    <PostAdd/>
                </div>
                <div className='postbody-box-right'>
                    <PostImg/>
                </div>
            </div>
            <button onClick={test}>test</button>
            <button onClick={test}>send</button>
        </div>
        <ProcessBody/>
        </>
    )
}

export default PostBody
